// Get company lists
var tsx = TSXjson.Companies;
var nys = NYSjson.Companies;
var nas = NASjson.Companies;

// Free up memory
TSXjson = null;
NASjson = null;
NYSjson = null;


// Initialize universal list to store company names from NYC, NASDAQ, TSX
var final = [];

// Collect names from each exchange
count = 0
for (i = 0; i < nys.length; i++){
	final.push(nys[i].Name);
}
for (i = 0; i < nas.length; i++){
	final.push(nas[i].Name);
}
for (i = 0; i < tsx.length; i++){
	final.push(tsx[i].Name);
}

// Free up memory
nas = null;
tsx = null;
nys = null;

final.sort();

// Initialize dictionary to store the index of the first letter occuring
var firsts = {"0": 0};
var previousLetter = "0";

// Populate indexing dictionary
for (i = 0; i < final.length; i++){
	if (final[i][0].toLowerCase() > previousLetter){
		firsts[final[i][0].toLowerCase()] = i;
		previousLetter = final[i][0].toLowerCase();
	}
}

// Primary search function
function matchPercent(phrase){

	// Front end stuff
	if (phrase == "") {
		$('#autofill').addClass('hidden');
	} else {
		if ($('#autofill').hasClass('hidden')){
			$('#autofill').removeClass('hidden');
		}
	}

	// Initializing vars to track quality of match
	var Plength = phrase.length;
	var bestRatio = 0;
	var suggestion = "";
	var ind;
	var firstChar = phrase[0].toLowerCase();
	var i = firsts[firstChar];

	// Loop while first letter of query matches first letter of sorted list of companies.
	while (final[i][0].toLowerCase() == firstChar){

		// If query string exists in company string
		if (final[i].toLowerCase().indexOf(phrase.toLowerCase()) > -1){

			// Hacky solution to a glitch, needs improvement
			if (Plength > 1 ){
				if (phrase.toLowerCase()[1] == final[i][1].toLowerCase()){
					if (Plength > 2 ){
						if (phrase.toLowerCase()[2] == final[i][2].toLowerCase()){

							// Select the shortest company name, thus query takes up largest %.
							if (Plength/final[i].length > bestRatio){
								bestRatio = Plength/final[i].length;
								suggestion = final[i];
							}
						}
					} else {
						if (Plength/final[i].length > bestRatio){
							bestRatio = Plength/final[i].length;
							suggestion = final[i];
						}
					}
				}
			} else {
				if (Plength/final[i].length > bestRatio){
					bestRatio = Plength/final[i].length;
					suggestion = final[i];
				}
			}
		}
		i += 1;
	}

	// Front end stuff
	if (suggestion == "") {
		$('#autofill').addClass('hidden');
	} else {
		if ($('#autofill').hasClass('hidden')){
			$('#autofill').removeClass('hidden');
		}
		$('#autofill').val(suggestion);
	}

	// Single company name
	return suggestion;
}


